  return (
    <section className="popup popup_lightbox">
      <div className="popup__container">
        <button className="popup__close" type="button"></button>
        <img className="popup__lbx-img" alt="" />
        <p className="popup__lbx-txt"></p>
      </div>
    </section>
  );
}
export default ImagePopup;
